import React from "react";
import "./Header.css";

function Header() {
  return (
    <div className="header_component">
      <header>
        <img className="header_img" src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngitem.com%2Fmiddle%2FiRJTbTJ_zendesk-logo-zendesk-logo-png-transparent-png%2F&psig=AOvVaw3My0Dbwq_XG5RGc5cnCAES&ust=1638579694198000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCPD04Ji3xvQCFQAAAAAdAAAAABAP"/>
        <h2 className="header_component_title">Zendesk Ticket Viewer</h2>
      </header>
    </div>
  );
}

export default Header;
